INSERT INTO `competitions` VALUES (1,'PNBWDC tingkat Perguruan Tinggi','Politeknik Negeri Bali Web Design Competition (PNBWDC) Merupakan salah satu sub event perlombaan dalam kegiatan “Information and Technology Festival (Intech Fest) 2022”. Yang dimana kegiatan ini berfokus dalam merancang serta membuat sebuah website yang memiliki peran sangat penting di era modern ini. Kegiatan ini ditujukan untuk Mahasiswa/i perguruan tinggi se-indonesia. Melalui kegiatan ini, diharapkan dapat meningkatkan kualitas dan membangun peran generasi muda yang terjun dalam bidang IT khususnya desain web dalam upaya peningkatan kualitas tenaga terampil melalui peningkatan keahlian dalam bidang desain web.','2021-08-02 01:27:35','2022-08-01 13:54:09'),(2,'PNBDC tingkat Perguruan Tinggi','Politeknik Negeri Bali Design Chellenge (PNBDC) Merupakan salah satu sub event perlombaan dalam kegiatan “Information and Technology Festival (Intech Fest) 2022”. Kegiatan ini akan berfokus dalam pembuatan sebuah desain UI/UX serta penyelesain suatu masalah yang nantinya akan dituangkan dalam sebuah desain yang menarik. Kegiatan ini bertujuan agar mampu memberikan penyelesaian masalah-masalah yang sering terjadi disekitar kita dengan output mampu memberikan solusi yang terbaik dan bisa diterapkan dengan bantuan teknologi seperti saat ini. Kegiatan ini ditujukan untuk Mahasiswa/i perguruan tinggi se-indonesia. Melalui kegiatan ini, diharapkan bisa berjalan secara kompetitif dan mampu memberikan peningkatan kualitas keterampilan dibidang UI/UX.','2021-08-02 01:28:00','2022-08-01 13:44:22'),(3,'PNBCTF tingkat Umum','PNBCTF (Politeknik Negeri Bali Capture The Flag) merupakan salah satu sub event perlombaan yang pertama kali diadakan dalam kegiatan “Information and Technology Festival (Intech Fest) 2022”. Kegiatan ini ditujukan untuk khalayak umum dengan ketentuan umur mulai dari 16 sampai 24 tahun. Dengan diadakannya kompetisi PNBCTF ini diharapkan agar dapat meningkatkan minat dan bakat mahasiswa terhadap keamanan dan ancaman siber, serta meningkatkan kemampuan mahasiswa dalam menciptakan keamanan siber dan mencegah berbagai macam ancaman siber seiring berkembangnya informasi dan teknologi.','2021-08-02 01:28:12','2022-08-01 13:50:00');
